/* SELECT * FROM TEMP_PSC_PARTS */

CREATE TABLE TEMP_PSC_PARTS (PART_ID NUMBER(5,0), NAME VARCHAR2(32 BYTE), WAFER_SIZE NUMBER(2,0) ) ;
CREATE SEQUENCE TEMP_PSC_PARTS_SEQ START WITH 1 INCREMENT BY 1;
CREATE OR REPLACE TRIGGER TEMP_PSC_PARTS_TRIGGER BEFORE INSERT ON TEMP_PSC_PARTS
  REFERENCING NEW AS NEW FOR EACH ROW BEGIN SELECT TEMP_PSC_PARTS_SEQ.nextval INTO :NEW.PART_ID FROM dual; 
END;



MERGE INTO PSC_PARTS orig
USING TEMP_PSC_PARTS temp ON (orig.name = temp.name)
WHEN NOT MATCHED THEN INSERT (orig.name, orig.wafer_size) VALUES (temp.name, temp.wafer_size);

commit;

DROP TRIGGER TEMP_PSC_PARTS_TRIGGER;
DROP SEQUENCE TEMP_PSC_PARTS_SEQ;
DROP TABLE TEMP_PSC_PARTS;
commit;
